import {React, useEffect} from 'react';

useEffect(() => {
    document.title = "Page Not Found";
}, []);

const NotFound
    = () => {
    return (
        <div className='container m-5'>
            <title>Not Found</title>
            <h2>ERROR-404</h2>
            <h5>Page Not Found</h5>
        </div>
    );
};

export default NotFound;
